class Solution:
    def spellchecker(self, wordlist: 'List[str]', queries: 'List[str]') -> 'List[str]':
        output = []
        w_set = set()
        l_case = {} #for lowercase
        remove_v = {} #for all the words, but replaced the vowels to ~
        for i, w in enumerate(wordlist):
            w_set.add(w)
            if w.lower() not in l_case:
                l_case[w.lower()] = []
            l_case[w.lower()].append(i)
            t = w.lower().replace('a','~').replace('e','~').replace('i','~').replace('o','~').replace('u', '~')
            if t not in remove_v:
                remove_v[t] = []
            remove_v[t].append(i)

        for q in queries:
            if q in w_set: # see if the q is in the w_set
                output.append(q)
            elif q.lower() in l_case:# if lowercased q is in the l_case
                output.append(wordlist[l_case[q.lower()][0]])
            else: #if q with vowels removed is in the remove_v
                t = q.lower().replace('a','~').replace('e','~').replace('i','~').replace('o','~').replace('u', '~')
                if t in remove_v:
                    output.append(wordlist[remove_v[t][0]])
                else:
                    output.append("")

        return output






